import { React, useState, useEffect } from "react";
import './LocationCity.css';

function LocationCity() {

    //Logica
   
        const [cities, setCities] = useState([])

      fetch('http://localhost:12911/api/MuyCercano/Ciudades')
        .then(response => response.json())
        .then(data =>  setCities(data.MCCiudad))
        .catch(error => console.error(error));

        //jsx
    return (
        <div class="field">
                <h3 className="titlesPagesD">
                    Ciudad
                </h3>
                <select id="cbxCiudad" name="cbxCiudad" className="ui search dropdown">
                    cities.map((city)=>{
                        <option key={LocationCity.Id} value={city.Id}>
      {city.Ciudad}
    </option>
    }
    )
                </select>
                
            </div>





    );
    }
     export default LocationCity;
